css:
:root {
  font-size: 16px;
}
.github-RemotePrController {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-PrInfo {
  padding: 1rem;
  overflow: auto;
  flex: 1;
  cursor: default;
}
.github-PrInfo .icon {
  vertical-align: middle;
}
.github-PrInfo .pinned-by-url {
  cursor: pointer;
}
.github-PrInfo .pinned-pr-info {
  display: flex;
  padding: 0.5rem;
  border: 1px solid rgba(122, 112, 82, 0.5);
  border-radius: 0.125rem;
  margin-bottom: 1rem;
}
.github-PrInfo .pinned-pr-info a {
  text-decoration: underline;
}
.github-PrInfo .pr-badge-and-link {
  display: flex;
  align-items: center;
  margin-bottom: 1rem;
}
.github-PrInfo .pr-badge-and-link .browser-link {
  display: inline-block;
  margin-left: 0.5em;
}
.github-PrInfo .pr-badge-and-link :last-child {
  flex: 1;
  text-align: right;
}
.github-PrInfo .pr-link a {
  color: rgba(122, 112, 82, 0.5);
  word-break: break-all;
}
.github-PrInfo .refresh-button .icon {
  color: rgba(122, 112, 82, 0.5);
  cursor: pointer;
}
.github-PrInfo .refresh-button .icon.refreshing::before {
  animation: github-RefreshButton-animation 2s linear 30;
}
@keyframes github-RefreshButton-animation {
  100% {
    transform: rotate(360deg);
  }
}
.github-PrInfo .pr-avatar-and-title {
  display: flex;
  align-items: center;
  margin-bottom: 0.5rem;
}
.github-PrInfo .author-avatar-link {
  margin-right: 0.5rem;
  align-self: flex-start;
}
.github-PrInfo .author-avatar {
  max-height: 32px;
  border-radius: 0.125rem;
}
.github-PrInfo .pr-title {
  margin: 0;
  line-height: 1.2;
  color: rgba(122, 112, 82, 0.6);
}
.github-PrInfo .merge-status,
.github-PrInfo .build-status {
  line-height: 2;
}
.github-PrInfo .merge-status.success .icon {
  color: #8BC34A;
}
.github-PrInfo .build-status.pending .icon {
  color: #d39e00;
}
.github-PrInfo .count-number {
  margin-left: .25em;
  font-size: 1.1em;
  font-weight: 600;
  line-height: 1;
}
.github-PrInfo .label {
  padding: 0 0.25rem;
  margin: 0 0.25rem 0.25rem 0;
  border-radius: 0.125rem;
  line-height: 2em;
  display: inline-block;
}
.github-PrInfo .reactions .reaction-group {
  margin-right: 1rem;
}
.github-PrInfo .github-PrStatuses {
  border-top: 1px solid rgba(0, 0, 0, 0.1);
  padding-top: 1rem;
}
.github-PrInfo .meta-info,
.github-PrInfo .conversation,
.github-PrInfo .commit-count,
.github-PrInfo .file-count,
.github-PrInfo .reactions,
.github-PrInfo .labels {
  border-top: 1px solid rgba(0, 0, 0, 0.1);
  padding: 0.5rem 0;
}
.github-PrInfo .conversation {
  cursor: pointer;
}
